import React from "react";
import './contato.css';
import fotoWpp from './wpz.png';
import fotoEmail from './eml.png';
import fotoInsta from './inst.png';

const button = document.getElementById('button');
const parentDivs = document.getElementsByClassName('parent');
const childDivs = document.getElementsByClassName('child');

button.addEventListener('click', () => {
  for (let i = 0; i < parentDivs.length; i++) {
    parentDivs[i].style.color = 'red';
  }
  for (let i = 0; i < childDivs.length; i++) {
    childDivs[i].style.color = 'red';
  }
});

function Contato (){
    return(
        
        <div id="parent" className="principaldiv">
            <button id="button">mudar</button>

        <div id="child" className="wpp"> 
        <a href="https://wa.me/qr/GMXY2NDMPPROI1" target ="_blank"><div className="foto1"><img id="wpp" src={fotoWpp}/></div></a>
            <div className="texto"> <h1 id="ctt">Whatssap <br/>  +55 19 1234-5678 <br/> 55+ 19 9876-5432</h1></div>
        </div>

        <div className="wpp"> 
            <div className="foto1"><img id="wpp" src={fotoEmail}/></div>
            <div className="texto"> <h1 id="ctt">Email <br/>  meuemail@hotmail.com <br/> meuemail2@hotmail.com</h1></div>
        </div>

        <div className="wpp"> 
        <a href="https://www.linkedin.com/in/henriquepizzi/" target ="_blank"><div className="foto1"><img id="wpp" src={fotoInsta}/></div></a>
            <div className="texto"> <h1 id="ctt">LinkedIn <br/>  in/henriquepizzi </h1></div>
        </div>

            
        </div>
    )
}

export default Contato
